import Box from '@mui/material/Box';
import { styled } from '@mui/system';

const BackgroundBox = styled(Box)({
    minHeight: '740px',
    
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContents: 'center',
});

export default BackgroundBox;
